function exportLevel()
{
    if (localStorage.getItem("level" + currentSaveIndex.toString()) != null && localStorage.getItem("userghost" + currentSaveIndex.toString()) != null)
    {
        let exportString = ""
        exportString += localStorage.getItem("level" + currentSaveIndex.toString())
        exportString += "{"
        exportString += localStorage.getItem("userghost" + currentSaveIndex.toString())
        navigator.clipboard.writeText(exportString)
        alert("Level Succesfully Copied to Clipboard")
    }
    else
    {
        alert("A ghost is required to export a level")
    }
    
}
function importLevel(indexToReturn)
{
    let levelCode = ""
    if (indexToReturn == -1)
    {
        levelCode = campaignLevels[currentCampaignIndex - 1]
    }
    else
    {
        levelCode = prompt("Enter a level code: ")
    }
    
    let i = 0
    while (levelCode[i] != "{")
    {
        i++
    }
    localStorage.setItem("importedlevel" + indexToReturn.toString(), levelCode.substring(0, i))
    localStorage.setItem("importedghost" + indexToReturn.toString(), levelCode.substring(i + 1, levelCode.length))
    
}

var scrollAmount = 0
function doLevelScrolling()
{
    let scrollSpeed = 20
    for (var i = 0; i < scrollSpeed; i++)
    {
        campaignLevelButton.y += scrollAmount
        if (Math.abs(campaignLevelButton.y - (canvas.height / 4)) < .5)
        {
            updateCampaignLevelInformation()
            scrollAmount = 0
        }
    }
    if (campaignLevelButton.y + campaignLevelButton.height < 0)
    {
        campaignLevelButton.y = canvas.height
        currentCampaignIndex--
    }
    else if (campaignLevelButton.y > canvas.height)
    {
        campaignLevelButton.y = -campaignLevelButton.height
        currentCampaignIndex++
    }
    campaignLevelButton.text = "Level " + currentCampaignIndex.toString()

    if (campaignActionButton.isClicked())
    {
        if (campaignActionButton.text == "Race Solo")
        {
            campaignActionButton.text = "Race Ghost"
        }
        else if (campaignActionButton.text == "Race Ghost")
        {
            campaignActionButton.text = "View Ghost"
        }
        else if (campaignActionButton.text == "View Ghost")
        {
            campaignActionButton.text = "Race Solo"
        }
    }
    if (scrollAmount == 0)
    {
        if (campaignActionButton.text == "Race Solo")//0 is edit, 1 is race solo, 2 is race ghost, 3 is delete level
        {
            driveMode = 0
            racingGhost = false
        }
        else if (campaignActionButton.text == "Race Ghost")
        {
            driveMode = 0
            racingGhost = true
            ghostRacingString = ghostWritingString
        }
        else if (campaignActionButton.text == "View Ghost")
        {
            driveMode = 1
            racingGhost = false
        }
    }
    campaignActionButton.draw()
    
}

